sourcesContent:
export const getUploadedFiles = ({ ui }) => ui?.files;

export const selectorDmsViewFiles = ({ dms }) => dms?.view?.files || [];
export const selectorDmsSearchFiles = ({ dms }) => {
  return dms?.search?.files || [];
};

export const getDmsContext = ({ ui }) => ui?.dmsContext;
export const getDmsVersionHistorySelector = ({ dms }) => dms?.view?.versionHistory?.items || [];

export const getDocumentMetaData = ({ dms }) => ({
  isDoc_Pending: dms?.upload?.documentMetaData?.status === 'PENDING' || false,
  isDoc_Fulfilled: dms?.upload?.documentMetaData?.status === 'SUCCESS' || false,
  isDoc_Rejected: dms?.upload?.documentMetaData?.status === 'REJECTED' || false,
  documentMetaData: dms?.upload?.documentMetaData?.data || {},
  documentDetails: dms?.upload?.document?.data || [],
});

export const getDocumentUploaded = ({ dms }) => ({
  isPending: dms?.upload?.documentUploaded?.status === 'PENDING' || false,
  isFulfilled: dms?.upload?.documentUploaded?.status === 'SUCCESS' || false,
  isRejected: dms?.upload?.documentUploaded?.status === 'REJECTED' || false,
  documentDto: dms?.upload?.documentUploaded?.data?.documentDto || [],
  refDocumentDto: dms?.upload?.documentUploaded?.refDocumentDto || [],
});

export const selectContextSubType = ({ dms }) => dms?.contextSubType || {};
